import * as React from 'react';
import { styled } from '@mui/material/styles';
import ArrowForwardIosSharpIcon from '@mui/icons-material/ArrowForwardIosSharp';
import MuiAccordion, { AccordionProps } from '@mui/material/Accordion';
import MuiAccordionSummary, {
  AccordionSummaryProps,
} from '@mui/material/AccordionSummary';
import MuiAccordionDetails from '@mui/material/AccordionDetails';
import Typography from '@mui/material/Typography';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import { Button } from '@mui/material';

export interface HostsData {
  _id:               string;
  name:              string;
  description:       string;
  OS:                string;
  Running_services:  number;
  Running_instances: number;
  health_status:     HealthStatus;
  services:          Service[];
  labels:            string[];
  "number of cores": number;
  processor_type:    string;
  memory:            string;
  total_storage:     string;
  storage_mounts:    StorageMount[];
}
export enum HealthStatus {
  Healthy = "Healthy",
  NotAvailable = "Not Available",
}

export interface Service {
  Name:      string;
  Instances: number;
}

export interface StorageMount {
  Mount_point: string;
  Storage:     string;
}


const Accordion = styled((props: AccordionProps) => (
  <MuiAccordion disableGutters elevation={0} square {...props} />
))(({ theme }) => ({
  border: `1px solid ${theme.palette.divider}`,
  '&:not(:last-child)': {
    borderBottom: 0,
  },
  '&:before': {
    display: 'none',
  },
}));

const AccordionSummary = styled((props: AccordionSummaryProps) => (
  <MuiAccordionSummary
    expandIcon={<ArrowForwardIosSharpIcon sx={{ fontSize: '0.9rem' }} />}
    {...props}
  />
))(({ theme }) => ({
  backgroundColor:
    theme.palette.mode === 'dark'
      ? 'rgba(255, 255, 255, .05)'
      : 'rgba(0, 0, 0, .03)',
  flexDirection: 'row-reverse',
  '& .MuiAccordionSummary-expandIconWrapper.Mui-expanded': {
    transform: 'rotate(90deg)',
  },
  '& .MuiAccordionSummary-content': {
    marginLeft: theme.spacing(1),
  },
}));

const AccordionDetails = styled(MuiAccordionDetails)(({ theme }) => ({
  padding: theme.spacing(2),
  borderTop: '1px solid rgba(0, 0, 0, .125)',
}));



export const ControlledAccordions: React.FC<{data:HostsData}>=({data})=> {
  const [expanded, setExpanded] = React.useState<string | false>('panel1');

  const handleChange =
    (panel: string) => (event: React.SyntheticEvent, newExpanded: boolean) => {
      setExpanded(newExpanded ? panel : false);
    };
  //   const x={
  //   "_id": "62cd1ed6abcbc185f5607e75",
  //   "name": "Christie",
  //   "description": "et ipsum nisi id deserunt sunt culpa consequat",
  //   "OS": "Vortexaco",
  //   "Running_services": 2,
  //   "Running_instances": 7,
  //   "health_status": "Not Available",
  //   "services": [
  //     {
  //       "Name": "Potter",
  //       "Instances": 3
  //     },
  //     {
  //       "Name": "Clare",
  //       "Instances": 3
  //     },
  //     {
  //       "Name": "Willa",
  //       "Instances": 3
  //     }
  //   ],
  //   "labels": [
  //     "host-1",
  //     "main-host"
  //   ],
  //   "number of cores": 4,
  //   "processor_type": "Intel Core",
  //   "memory": "15.4 GiB",
  //   "total_storage": "512 GiB",
  //   "storage_mounts": [
  //     {
  //       "Mount_point": "abc",
  //       "Storage": "23"
  //     }
  //   ]
  // };
  console.log("data")
  console.log(data[0]);
  const x=data[0];
  console.log("X=");
  console.log(x)

  const handleHostConnect=()=>{
    console.log(" connect to host");
  }
  return (

    <div>
      <Accordion expanded={expanded === 'panel1'} onChange={handleChange('panel1')}>
        <AccordionSummary aria-controls="panel1d-content" id="panel1d-header">
          <Typography>Basic Information</Typography>
        </AccordionSummary>
        <AccordionDetails>
        <Paper>

      <Table >
        <TableHead>
          <TableRow>
            <TableCell>OS</TableCell>
            <TableCell align="right">{x.OS}</TableCell>
            </TableRow>
            <TableRow>
            <TableCell>Processors</TableCell>
            <TableCell align="right">{x.processor_type}</TableCell>
            </TableRow>

            <TableRow>
            <TableCell>Memory</TableCell>
            <TableCell align="right">{x.memory}</TableCell>
            </TableRow>
            <TableRow>
            <TableCell>Storage</TableCell>
            <TableCell align="right">{x.total_storage}</TableCell>

          </TableRow>
        </TableHead>
       </Table>
    </Paper>

        </AccordionDetails>
      </Accordion>
      <Accordion expanded={expanded === 'panel2'} onChange={handleChange('panel2')}>
        <AccordionSummary aria-controls="panel2d-content" id="panel2d-header">
          <Typography>Services</Typography>
        </AccordionSummary>
        <AccordionDetails>
          <Paper>
        <Table>
        <TableHead>
          <TableRow>
            <TableCell>Services assigned</TableCell>
            <TableCell align="right"># of instances running</TableCell>

          </TableRow>
        </TableHead>
        <TableBody>
          {x.services.map(row => (
            <TableRow key={row.Name}>
              <TableCell component="th" scope="row">
                {row.Name}
              </TableCell>
              <TableCell align="right">{row.Instances}</TableCell>

            </TableRow>
          ))}
        </TableBody>
      </Table>
      </Paper>

        </AccordionDetails>
      </Accordion>
      <Accordion expanded={expanded === 'panel3'} onChange={handleChange('panel3')}>
        <AccordionSummary aria-controls="panel3d-content" id="panel3d-header">
          <Typography>Health</Typography>
        </AccordionSummary>
        <AccordionDetails>
          <Typography>
          {x.health_status}
          {/* Expanding this table will show the server health dashboard for the host. */}
          </Typography>
        </AccordionDetails>
      </Accordion>
      <Accordion expanded={expanded === 'panel4'} onChange={handleChange('panel4')}>
        <AccordionSummary aria-controls="panel4d-content" id="panel4d-header">
          <Typography>Connect</Typography>
        </AccordionSummary>
        <AccordionDetails>
          <Typography>
           Expanding this provides a button to initiate SSH Connection to the host through the browser
          </Typography>
          <Button variant="contained" onClick={handleHostConnect}>Connect to Host</Button>
        </AccordionDetails>
      </Accordion>
    </div>
  );
}
